package com.jeremyeliassen.anexcellenthost.tests;

import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import com.jeremyeliassen.anexcellenthost.models.Image;
import com.jeremyeliassen.anexcellenthost.services.ImageService;

import static org.junit.jupiter.api.Assertions.assertEquals;

@SpringBootTest
class ImageIT {
	private ImageService imageService;
	
	@Autowired
	public ImageIT(ImageService imageService) {
		this.imageService = imageService;
	}
	
	@Test
	void TestFindImageById() {
		Image newImage = new Image();
		newImage.setImageId(1);
		newImage.setImageName("bizza.jpg");
		newImage.setDescription("This is merely a test");
		newImage.setImageItself("");
		newImage.setImageFileName("Pizza, not a cat");
		Image saveImage = imageService.save(newImage);
		int saveImageId = saveImage.getImageId();
		int testImage = imageService.findImageById(saveImage.getImageId()).getImageId();
		assertEquals(saveImageId, testImage);
	}
	
	@Test
	void testFindByImageName() {
		Image testImage = new Image();
		testImage.setImageId(1);
		testImage.setImageName("bizza.jpg");
		testImage.setDescription("This is merely a test");
		testImage.setImageItself("");
		testImage.setImageFileName("Pizza, not a cat");
		Image saveImage = imageService.save(testImage);
		String saveImageName = saveImage.getImageName();
		String finalTestImage = imageService.findImageByName(testImage.getImageName()).getImageName();
		assertEquals(saveImageName, finalTestImage);
	}
	

}
